css:
.tab-control-status {
  color: #a8a8a8;
}
.tab-control-status:hover {
  cursor: pointer;
  text-decoration: underline;
}
.tab-control .list-group li {
  border: 1px solid transparent !important;
}
.tab-control .list-group .seperator + li {
  border-top: 1px solid #181818 !important;
}
.tab-control .list-group .seperator {
  display: none;
}
